static int bma423_device_init(struct i2c_client *client) {
	int result;
	struct bma423_data *pdata = i2c_get_clientdata(client);
	printk(" joes dev ini  \n");
 	result = i2c_smbus_write_byte_data(client, BMA423_CTRL_REG1, 0);
	if (result < 0)
		goto out;
	result = i2c_smbus_write_byte_data(client, BMA423_XYZ_DATA_CFG, pdata->mode);
	if (result < 0)
		goto out;
	pdata->active = BMA_STANDBY;
	msleep(MODE_CHANGE_DELAY_MS);
	return 0;
out:
	dev_err(&client->dev, "error when init bma423:(%d)", result);
	return result;
}
