	u8 tmp_data[BMA423_BUF_SIZE];
	int ret;
	printk(" joes readdd dat \n");
 	ret = i2c_smbus_read_i2c_block_data(client, BMA423_OUT_X_MSB_2, BMA423_BUF_SIZE, tmp_data);
	if (ret < BMA423_BUF_SIZE) {
		dev_err(&client->dev, "i2c block read failed\n");
		return -EIO;
	}
	//  printk("\n 000x %x %x %x %x %x %x \n", tmp_data[0], tmp_data[1], tmp_data[2], tmp_data[3],tmp_data[4],tmp_data[5]);
	// data->x = ((tmp_data[0] << 8) & 0xff00) | tmp_data[1];data->y = ((tmp_data[2] << 8) & 0xff00) | tmp_data[3];data->z = ((tmp_data[4] << 8) & 0xff00) | tmp_data[5];return 0; 
