static int bma423_probe(struct i2c_client *client, const struct i2c_device_id *id) {
	int result, resK,chip_id=0x1a;
	struct input_dev *idev;
	struct bma423_data *pdata;
	struct i2c_adapter *adapter;
	struct device_node *of_node = client->dev.of_node;
	u32 pos = 0;
	struct regulator *vdd, *vdd_io;
	u32 irq_flag;
	struct irq_data *irq_data;
	printk(" joes bma423 probe time: %s  \n", __DATE__);//joes
	adapter = to_i2c_adapter(client->dev.parent);
	result = i2c_check_functionality(adapter, I2C_FUNC_SMBUS_BYTE | I2C_FUNC_SMBUS_BYTE_DATA);
	if (!result)
		goto err_out;
 	chip_id = i2c_smbus_read_byte_data(client, BMA_BMA423_WHO_AM_I);
	printk(" joes chip id:%x \n", chip_id);//if (!bma423_check_id(chip_id)) { dev_err(&client->dev, "read chip ID 0x%x is not equal to 0x%x,0x%x,0x%x,0x%x,0x%x!\n", chip_id, BMA8451_ID, BMA8452_ID, BMA8453_ID, BMA8652_ID, BMA8653_ID);result = -EINVAL;goto err_out;} 
	pdata = kzalloc(sizeof(struct bma423_data), GFP_KERNEL);
	if (!pdata) {
		result = -ENOMEM;
		dev_err(&client->dev, "alloc data memory error!\n");
		goto err_out;
	}
	memset(pdata, 0, sizeof(struct bma423_data));/* Initialize the BMA423 chip */ 
	pdata->client = client;
	pdata->chip_id = chip_id;
	pdata->mode = MODE_2G;
	pdata->fifo_wakeup = 0;
	pdata->fifo_timeout = 0;
 	result = of_property_read_u32(of_node, "position", &pos);resK=result;if (result) pos = 1;
	pdata->position = (int)pos;p_bma423_data = pdata;
	mutex_init(&pdata->data_lock);
	i2c_set_clientdata(client, pdata);
 	bma423_device_init(client);
 	idev = input_allocate_device();
	if (!idev) {
		result = -ENOMEM;
		dev_err(&client->dev, "alloc input device failed!\n");
		goto err_alloc_input_device;
	}
	idev->name = "yuancheng";idev->uniq = "bma423";// bma423_id2name(pdata->chip_id);
	idev->id.bustype = BUS_I2C;idev->evbit[0] = BIT_MASK(EV_ABS);
	input_set_abs_params(idev, ABS_X, -0x7fff, 0x7fff, 0, 0);
	input_set_abs_params(idev, ABS_Y, -0x7fff, 0x7fff, 0, 0);
	input_set_abs_params(idev, ABS_Z, -0x7fff, 0x7fff, 0, 0);
	dev_set_drvdata(&idev->dev, pdata);pdata->idev = idev;
	result = input_register_device(pdata->idev);
	if (result) {
		dev_err(&client->dev, "register input device failed!\n");goto err_register_input_device;
	}
	pdata->delay = POLL_INTERVAL;
	INIT_DELAYED_WORK(&pdata->work, bma423_dev_poll);
	result = sysfs_create_group(&idev->dev.kobj, &bma423_attr_group);
	if (result) {
		dev_err(&client->dev, "create device file failed!\n");result = -EINVAL;goto err_create_sysfs;
	}
	init_waitqueue_head(&pdata->fifo_wq);
	printk(KERN_INFO"bma423 device driver probe successfully\n");
	config_bma(client);
	return 0;
	err_reigster_dev:
		free_irq(client->irq, pdata);
	err_register_irq:
		sysfs_remove_group(&idev->dev.kobj, &bma423_attr_group);
	err_create_sysfs:
		input_unregister_device(pdata->idev);
	err_register_input_device:
		input_free_device(idev);
	err_alloc_input_device:
		kfree(pdata);
	err_out:
		return result;
}
static int bma423_remove(struct i2c_client *client) { 
	struct bma423_data *pdata = i2c_get_clientdata(client);
	struct input_dev *idev = pdata->idev;
	if (pdata) { 
		sysfs_remove_group(&idev->dev.kobj, &bma423_attr_group);
		input_unregister_device(pdata->idev);
		input_free_device(pdata->idev);
		kfree(pdata);
	}
	return 0;
}
